import React from "react";
import BannerImage from "../Banner-Image /image-banner";
import img from "../../src/assest/cycle.png";
import './Banner.less'

const Banner = () => {
  return (
    <div className="banner-container">
      <BannerImage
        src={img}
        aspectRatio={{ desktop: "1920:923", mobile: "360:736" }}
      />
      <div className="text-on-image">
        <div className="text">
          <p> BUILT FOR URBAN ADVENTURES & BEYOND</p>
        </div>
        <div className="btn-container">
          <button className="btn-onimage"></button>

        </div>
      </div>
    </div>
  );
};

export default Banner;
